import React from 'react';
import { Link, Route, Switch } from 'react-router-dom';
import './App.css';
//import HomePage from './pages/homepage/homepage.component';


const TopicList = (prop) => {
  console.log(prop);
  return (
    <div>
      <h1>TopicList PAGE</h1>
    </div>
  );
};

const TopicDetails = (prop) => {
  console.log(prop);
  return (
    <div>
      <h1>{prop.match.params.topicId}</h1>
    </div>
  );
};
const HomePage = (prop) => {
  console.log(prop);

  return (
    <div>
      <Link to='/topics'>TopicList</Link>
      <button onClick={() => prop.history.push('/topics')}>TopicList</button>
      <h1>HomePage PAGE</h1>
    </div>
  );
};



function App() {
  return (
    <div className="App">
      <Route  path='/' component={HomePage} />
      <Route exact path='/topics' component={TopicList} />
      <Route path='/topics/:topicId' component={TopicDetails} />

    </div>
  );
}

export default App;
